(41368, '9C000EB9-3DB8-4254-8B70-769055144A7C', 'I️ struggle with what to do when you say you aren’t going to do something that we talked about you doing. So I️’d love to figure out a norm for how to engage in that moment. Kiki really needs to run at least twice a day. So I’m asking in the kindest way I️ can for you to take her out for a good long run today twice. That’s what I️ thought we had agreed to.', 'Nitzan', 'David', '2022-01-17T13:27:08.379283'),
(41369, '5D632E20-C5CD-40F5-B6EE-AF5954497ECD', 'I️’m also not sure what you mean when you say that you aren’t looking to make any changes…but I️ appreciate you acknowledging my anxiety around opening up again. I️ want to do it and I️ want it to feel like we have the right balance in place. So thank you for helping me feel loved and cared for as we test it out again. It’s good for us to have our agreements written down as you start engaging with Ilsa again so let’s write them or review them tonight (if you get to work on a draft today). And please help her understand that it’s possible that things could shut down if we are fighting. I️ just want to be sure she knows what it means to be engaging. Pricilla said it needs to be within 12 hours, so I️’m asking that she be on board with that. I️’m hopeful that we won’t need to shut down anytime again and that we’ll have a better balance this time around, but it’s important to me that she understand. My people understand this too.', 'Nitzan', 'David', '2022-01-17T13:37:34.682312'),
